(()=>{"use strict";let t=new class{history=[];constructor(t){this.str=t}setHistory(t,s,r){this.history.push({function:s,args:Array.isArray(t)?t.join(","):t,result:r})}get history(){return this.history}reverseStr(){const t=[...this.str].reverse().join("");return this.setHistory(this.str,this.reverseStr.name,t),t}nTimes(t){let s=this.str.repeat(+t);return this.setHistory([this.str,t],this.nTimes.name,s),s}getPart(){let t=Math.round(this.str.length/2),s=this.str.substr(t);return this.setHistory(this.str,this.nTimes.name,s),s}removeDuplicates(){let t=this.str.replace(/(.)(?=.*\1)/g,"");return this.setHistory(this.str,this.nTimes.name,t),t}}("JavaScript");console.log(t.reverseStr()),console.log(t.nTimes("2")),console.log(t.getPart()),console.log(t.removeDuplicates()),console.log(t.history)})();